import React, { useEffect, useState  } from 'react';
import { Fragment } from 'react';

import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  NavbarText,
} from 'reactstrap';


function Acc(args) {
const now = 60; 

const [progress, setProgress] = useState(0);
 
let progressInterval = null;


  useEffect(() => {
    progressInterval = setInterval(() => {
      setProgress(prev => prev + 1);
    }, 1000);
    
  }, []);

  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

 
    return (
      <div className='body' >
        {/* {progress<100  &&
        <div className="row d-flex justify-content-center">
          <div className="col-8 myProg">
            <ProgressBar className="gg" now={progress} label={`${progress}%`}/>
          </div>
        </div>} */}
       
       <Navbar className="row p-2 d-flex" color="light">
        <NavbarBrand className='col-7 d-flex justify-content-start' href="/">
          <img alt="logo" src="Nexadz.png" style={{height: 30,width: 80}}/>
        </NavbarBrand>
        <NavbarText className='col-3 d-flex justify-content-end'>
          <div className='d-flex'>
            <div><img alt="logo" src="person.svg" className='bg-primary p-2 rounded'/></div>
            <div>
              <div>Administrator</div>
              <div>
              
              <DropdownToggle nav caret>
                Options
              </DropdownToggle>
              <DropdownMenu right>
                <DropdownItem>Option 1</DropdownItem>
                <DropdownItem>Option 2</DropdownItem>
                <DropdownItem divider />
                <DropdownItem>Reset</DropdownItem>
              </DropdownMenu>
            
              </div>
            </div>
          </div>
        </NavbarText>
    
    </Navbar>
    </div>
      
      
    );
  }
  
  export default Acc;
